import Nav from "../nav";
function Labs() {
    return(
       <div>
            <Nav/>
            <Assignment6/>
       </div>
    );
 }
 export default Labs;

 function Classes() {
    const color = 'blue';
    const dangerous = true;
    return (
        <div>
            <h2>Classes</h2>
            <div className={`${dangerous ? 'wd-bg-red' : 'wd-bg-green'}
                                        wd-fg-black wd-padding-10px`}>
            Dangerous background</div>
        </div>
    );
}
